    false,nt"url": null,nt"notes": "The Magnuson-Stevens Fishery Conservation
    and Management Act (MSA) is the primary law governing marine fisheries management
    in U.S. federal waters. It has since been amended by several statutes, including
    the "Sustainable Fisheries Act" in 1996 and the Magnuson-Stevens Fishery Conservation
    and Management Reauthorization Act of 2006, in 2007. The original 1976 Act extended
    U.S. fisheries jurisdiction to 200 miles. The 1976 Act aided in the development
    of the domestic fishing industry by providing for the phase-out of foreign fishing.
    To manage the fisheries and promote conservation, the 1976 Act created eight regional
    fishery management councils. The 1996 Act focused on rebuilding overfished fisheries,
    protecting fish habitat, and reducing bycatch. The 2006 amendments mandated the
    use of annual catch limits and accountability measures to end overfishing, provided
    for limited access privilege programs, and called for increased international cooperation.
    Source: http://www.nmfs.noaa.gov/msa2007/details.html and http://www.nmfs.noaa.gov/msa2007/
    Date Enacted: April 13, 1976 Codification: 16 U.S.C. Section 1801 et seq. Authority:
